import Footer from "./Footer";
import Navbar from "./Navbar";
import './About.css';
function About(){
    return (
        <div className='home'>
            <Navbar/>
            <div className='about'>
                   <center><h2>About Us</h2></center> 
                  
                    
                
                <Footer/>
            </div>
        </div>
    )
}

export default About;
